import axios from "axios";
import https from "https";

let axiosInstance = axios.create({
	baseURL: `${process.env.REACT_APP_API_URL}/api/v1`,
	httpsAgent: new https.Agent({
		rejectUnauthorized: false
	})
});

export default axiosInstance;
